var b="url",c="请假.html",d="generationDate",e=new Date(1511849568075.11),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="sketchKeys",j="",k="s0",l="variables",m="OnLoadVariable",n="page",o="packageId",p="884f2e8e85ea4c58b3b03ab513bc23be",q="type",r="Axure:Page",s="name",t="请假",u="notes",v="Note",w="<p><span>1.管理层，决策层</span></p><p><span>2.执行层</span></p><p><span><br></span></p><p><span>3.</span><span>请假：主送人审核，抄送人只是知悉</span></p><p><span>1.请假&lt;3天的要提前一天，主送人（是下发任务的所有人），抄送给请假人的上级，如果当事人是执行层，还要抄送项目经理；</span></p><p><span>2.请假&gt;3天的要提前一周，主送总经理，抄送部门项目组/部门管理层、决策层人员。</span></p><p><span>3.请假要体现工作交接情况，要关联工作交接功能，读取请假时间段内是否有工作交接记录，审核人可以在请假审批时查看工作交接详情。</span></p><p><span><br></span></p><p><span>1、执行层、管理层请假，&lt;3天，分别为管理层、决策层审批；&gt;或=3天都由决策层审批</span></p><p><span><br></span></p><p><span>2、决策层的请假，&gt;1天，总经办审核；</span></p><p><span>&lt;或=1天，由同层级人审批</span></p>",x="style",y="baseStyle",z="627587b6038d43cca051c114ac41ad32",A="pageAlignment",B="near",C="fill",D="fillType",E="solid",F="color",G=0xFFFFFFFF,H="image",I="imageHorizontalAlignment",J="imageVerticalAlignment",K="imageRepeat",L="auto",M="favicon",N="sketchFactor",O="0",P="colorStyle",Q="appliedColor",R="fontName",S="Applied Font",T="borderWidth",U="adaptiveStyles",V="interactionMap",W="diagram",X="objects",Y="id",Z="114c93611fa746a3bf630d9c5dcb4e15",ba="label",bb="friendlyType",bc="组合",bd="layer",be="styleType",bf="visible",bg=true,bh="imageOverrides",bi="objs",bj="d68a071570d04129bfabb73df0747cea",bk="图片",bl="imageBox",bm="location",bn="x",bo=10,bp="y",bq="size",br="width",bs=400,bt="height",bu=842,bv="75a91ee5b9d042cfa01b8d565fe289c0",bw="73afb5aa72274e58ae31e532c7c8fbba",bx="isContained",by="richTextPanel",bz="paragraph",bA="images",bB="normal~",bC="images/登录/u27.jpg",bD="ce0884be2002494faa2987305bd22e01",bE="矩形",bF="vectorShape",bG=42,bH=132,bI=340,bJ=600,bK=0xFFF2F2F2,bL="40519e9ec4264601bfb12c514e4f4867",bM="382b383b02ca492298a0557e87bfcadc",bN="generateCompound",bO="propagate",bP="51bd9daab2814becb2f7e94b12f1e112",bQ=131,b